insert into `article` values ('1','广州：中医又派上大用场了！','中医','181','0','2023-04-08 22:27:35.0','2023-04-08 22:27:35.0',null,null,null,'<p><span style="color: rgb(89, 89, 89);">广州疫情防控仍在吃紧阶段。连日来，各大医院支援方舱的医护人员也在一线全力救治患者，中医人便是其中一支重要力量。来自广东省中医院、广州中医药大学第一附属医院、广州中医药大学第三附属医院、中山大学附属第三医院、中山大学附属孙逸仙纪念医院、广州医科大学附属中医医院等多家医院的中医力量，都在各自接管的方舱中打出“中西医组合拳”，充分发挥中医药优势帮助患者康复。汤药、针灸、推拿等特色疗法不但缓解了患者病痛、助力维护医护人员和志愿者工作人员健康，也疗愈了人们的心灵。</span></p><p><br></p><p><strong style="color: rgb(0, 122, 170);">遇到会“捏脊”会施针的大白</strong></p><p><br></p><p><span style="color: rgb(89, 89, 89);">自广州中医药大学第一附属医院接管琶洲方舱医院C14馆以来，医护团队通过个体化辨证后，运用中药汤剂、中成药，结合耳穴压豆、穴位按摩、小儿推拿等中医特色疗法帮患者缓解症状。</span></p><p><br></p><p><span style="color: rgb(89, 89, 89);">11月18日晚上，在广州中医药大学第一附属医院负责的广州琶洲方舱里，一位妈妈抱着五岁大的女儿小雨（化名）来到医护服务区求助。原来小雨转运过来时就有点咳嗽、咽痛，胃口差，肚子不舒服，还有点发热。“大白”用中医“捏脊”的方法，帮小雨缓解了不适。</span></p><p><br></p><p><span style="color: rgb(89, 89, 89);">11月20日凌晨，李姨（化名）出现持续牙疼，服用止痛药一时也难以缓解，值班“大白”为她做针灸和穴位按摩，李姨的牙痛逐渐减轻了。</span></p><p><br></p><p><strong style="color: rgb(0, 122, 170);">初进方舱宝宝积食 揉腹几下舒服多了</strong></p><p><br></p><p><span style="color: rgb(89, 89, 89);">方舱内，孩子不适应离家在外的陌生环境，胃口不好还排不出便怎么办？15日凌晨3时，省中医院医疗队来自中医经典科的队员彭颖用中医传统疗法的小儿推拿手法帮助了一位3岁的小患者。来了方舱已经两天未解大便的宝宝，腹部胀痛，胃口不好，在凌晨哭闹起来，父母怎么哄也没用。彭颖判断应该是积食引起的不适，便温柔地和孩子玩起了“游戏”——经过推拿推四横纹、揉板门、清大肠、清胃经，以及顺时针腹部按摩，小朋友的症状缓解不少，终于安静下来。彭颖嘱咐家属，要给小孩先吃粥顾护脾胃，还手把手教会了父母揉腹的方法，帮助小朋友通便。省中医儿科团队针对新冠肺炎儿童患者特别设计的以解决退热、咳嗽，以及改善呕吐、腹泻、便秘等消化道症状为主要目标的这套手法，果然在方舱派上了用场。</span></p><p><br></p><p><span style="color: rgb(89, 89, 89);">在省中医院接管的19号方舱，医护人员还用教会了孕妈妈按压迎香穴、缓解鼻塞；细心发现了9个月宝宝的鹅口疮、教会了父母护理的办法。</span></p><p><br></p><p><strong style="color: rgb(0, 122, 170);"><span class="ql-cursor">﻿</span>救治急症 雷神山的“银针”再现方舱</strong></p><p><br></p><p><span style="color: rgb(89, 89, 89);">在广东省中医院医疗队接管的琶洲方舱医院19号舱，由于医疗条件有限，中医人结合以往支援武汉等多地抗疫的临床实践经验，在病区里建立了小型抢救室，配备气管插管、除颤仪等抢救设备，同时，针对患者实际情况，运用中医特色疗法为患者保驾护航。近日，医疗队使用针灸等中医疗法接连救治了发生紧急症状的患者。医疗队长邹旭教授一套曾在武汉雷神山救治许多患者的针灸技法，也再次出现在广州方舱，为患者解除病痛。</span></p><p><br></p><p><span style="color: rgb(89, 89, 89);">11月16日21:30，医生在19号舱内巡查期间，发现患者张先生突发喉痉挛，四肢抽搐。医护人员见状立即将患者扶上急救床，评估生命体征、紧急检查心电图、做好静脉输液准备、做好保暖措施、通知舱里其他医生过来查看。经初步检查，张先生曾有低钙血症病史，之前有过类似症状。随后，医护人员立即进行对症处理，并按压合谷、太冲、太溪等穴位，患者抽搐不适症状缓解不少，但仍未完全停止抽搐。</span></p><p><br></p><p><span style="color: rgb(89, 89, 89);">此时，邹旭教授闻讯赶到，立即予针刺合谷、太冲、太溪等穴位。特别是捻转合谷穴时，患者马上出了汗，抽搐也逐渐停止。“我感觉身体暖和了，不那么难受了。”张先生转过头对医护人员说。随后，邹旭教授给患者开服了扶正解毒颗粒，并留针30分钟观察。患者终于安下心来，顺利转往定点医院进行后续治疗。</span></p>','/api/upload/1597552611626582017.jpg',null);
insert into `article` values ('2','中医不传之秘在于用量','中医','871','0','2023-04-08 22:27:35.0','2023-04-08 22:27:35.0',null,null,null,'<p><br></p><p class="ql-align-justify">“中医不传之秘在于用量”，此话不无道理。</p><p class="ql-align-justify"><br></p><p class="ql-align-justify">盖其一，从单味药言，<span style="color: rgb(135, 36, 32);">量变超出一定限度，必然会引起质变</span>，故剂量不同，功效有别。如<span style="color: rgb(55, 66, 121);">附子小量可温补脾肾，中量能祛寒止痛，大量则回阳救逆；红花小量可生血，中量能活血，大量则破血；大黄小量可健胃，中量清湿热，大量则泻下；黄芪小量无利尿效应，中量能显著利尿，大量则反使尿量减少；川芎小量能升高血压、大量反使血压下降</span>等等。处方遣药，切莫一概认为量大则功胜，而盲目追求大剂应用，要因病、因人、因药制宜，力求做到既对症，又适中，否则难以达到预期效果。</p><p class="ql-align-justify"><br></p><p class="ql-align-justify">其二，从组方配伍言，<span style="color: rgb(135, 36, 32);">一方中药有主次，各药间又相互影响，彼此制约</span>，故临证施治除，依法准确选择方药外，还要恰当处理好药物之间的量的关系。须知，适应不同病证的不同方剂，其主药间或主次药间各具一定的相对有效的剂量比例，倘此比例失调，势必导致全方功效重心的改变。如<span style="color: rgb(55, 66, 121);">桂枝汤中桂枝和芍药等量，才能调和营卫，解肌发表；若倍用桂枝，则变为温阳降逆的桂枝加桂汤；若倍用白芍，就成了解表和里的桂枝加芍药汤。</span>再如<span style="color: rgb(55, 66, 121);">麻黄汤中麻黄与桂枝的用量应是三比二；枳术丸中的白术与枳实的用量应是二比一</span>；<span style="color: rgb(55, 66, 121);">白虎汤中的石膏用量宜三倍于知母</span>；<span style="color: rgb(55, 66, 121);">当归补血汤中的黄芪用量宜五倍于当归；麦门汤中的半夏用量应为麦冬的六分之一左右；一贯煎中的川楝子用量应为生地的五分之一左右</span>。</p><p class="ql-align-justify"><br></p><p class="ql-align-justify">如果不明这些行之有效的不传之秘（当然也可酌情调整或探索更佳比例），动辄药量相平，主次不分，甚或比例颠倒，喧宾夺主，虽方与证合，其效难求。</p><p class="ql-align-justify"><br></p><p class="ql-align-justify">吾随王文鼎老师临证，曾见一患者，女，40岁。因<span style="color: rgb(55, 66, 121);">感冒后反复咳嗽，酿成哮喘已三月，半月来加剧</span>，经用抗生素及激素无效，又服定喘汤与小青龙汤亦不应。王老诊后，确认<span style="color: rgb(135, 36, 32);">寒饮</span>，予麻黄根30克、桂枝9克、白芍18克、制半夏12克、炮姜、五味子、细辛、甘草各6克。药进两剂，喘息得平。或问，前已投小青龙汤，并不见功，何故王老用之顿效？关键就在用量上。王老曰：“用小青龙要掌握仲景治痰食咳嗽的<span style="color: rgb(135, 36, 32);">姜、辛、味</span>三个要药，此三药一般当等量用之，注意调节升降开合的适宜。方中麻黄的运用亦有分寸，<span style="color: rgb(135, 36, 32);">初期表实用麻黄，次用麻黄绒，后期喘而汗出用麻黄根30克</span>。至于<span style="color: rgb(135, 36, 32);">桂枝与白芍用量，初期宜等量，病久渐虚，须白芍倍桂枝，仿建中意在收敛。</span>”王老对经方之研究，堪称至为精细，因而深得仲景用量之奥秘，故临证运用自由。</p><p><br></p>','/api/upload/1597552200790310912.jpg',null);
insert into `article` values ('3','海丰增加隔离医学观察酒店 应对疫情防控需要','中医','31','0','2023-04-08 22:27:35.0','2023-04-08 22:27:35.0',null,null,null,'<p><img src="data:image/png;base64,"></p><p><br></p><p>11月28日，副县长阳宇率队调研指导新增隔离医学观察酒店启用准备工作。要求相关部门把握细节、规范工作流程、提高工作效率，把隔离管控工作做细做实。</p><p>阳宇一行先后到怡冠假日、贝金赛尔等隔离医学观察酒店，详细了解酒店内部运行流程、防控措施、服务保障等工作情况，对酒店隔离措施设置不规范的，提出改进意见。</p><p>阳宇指出，当前疫情防控形势严峻复杂，各级各部门要提高认识，进一步提升服务效能，强化隔离医学观察酒店精细化管理，守好守牢疫情防控阵地；要进一步科学调配人员力量、优化组合，强化协同配合，提高工作效率；要严格规范消毒消杀、垃圾转运工作流程，降低感染风险；要从严从细抓好隔离管控各项措施，加快补齐短板，推动管控工作更加精细、精准，安全有序，切实筑牢疫情防控坚固屏障。</p><p><br></p><p>融媒记者：陈志明</p><p>	<strong style="color: rgb(0, 0, 0);">	</strong></p><p><strong>总监制：黄雄飞&nbsp;</strong></p><p><strong>监&nbsp;&nbsp;制：陈小龙&nbsp;</strong></p><p><strong>编&nbsp;&nbsp;审：曾树佳&nbsp;曾思凡&nbsp;</strong></p><p><strong>编&nbsp;&nbsp;辑：朱超明 洪堉凯</strong></p><p><strong style="color: rgb(255, 0, 0);">	声明：	转载需注明出处，未经许可不得更改内容。</strong></p>','/api/upload/1597550758763429889.jpg',null);
insert into `article` values ('4','江西首个中医经典科正式开科','中医','838','0','2023-04-08 22:27:35.0','2023-04-08 22:27:35.0',null,null,null,'<p>	3月8日，经过一段时间的筹备和试运行，江西第一个中医经典科在江西中医药大学附属医院正式开科。</p><p>	</p><p>	医院党委副书记、院长刘良徛参加仪式并致辞。院领导翁剑锋、罗小亮、杨卫星参加揭牌仪式。</p><p>	&nbsp;</p><p>	刘良徛指出，中医经典科的成立，是医院加强内涵建设、充分发挥中医药特色优势的重要举措。它的开设将进一步提高医院中医文化内涵，推进中医药人才培养与团队建设，为老百姓提供更加优质的中医药服务与中西医协同诊疗服务，为疑难危重病人提供更多救治手段。</p><p><img src="data:image/png;base64,"></p><p><br></p><p>	中医经典科负责人胡子毅表示，中医经典科将不断创新中医药临床诊疗模式，提升中医药防治重大疑难疾病能力、中医治未病服务能力、中医康复服务能力，将中医经典病房积累的成功诊疗经验推广应用。同时开展中医药人才毕业后教育、继续教育以及师承教育，为促进中医药人才的健康成长做贡献。</p><p><br></p><p><img src="data:image/png;base64,"></p><p><br></p><p>	中医经典科将运用中医经典理论与名老中医经验指导临床，充分发挥中医特色与优势，在疾病诊治中积极探索运用中医主导的方法和技术开展各种急危重症和复杂疑难病的诊治工作，坚持“能中不西、先中后西、中西联合”的原则。其最大特色为“立足中医经典，以中医为主导的方法和技术开展疾病诊疗。”。科室综合运用中药汤剂、膏方及其他各种制剂，针刺、推拿、灸法、罐法、刮痧、热奄包等中医传统特色外治，充分发挥中医中药简、便、验、廉的优势。在临床上针对不同的病种及优势环节，以“辩证选用、灵活组合”的方式，将针、灸、药这些中医特色疗法有机结合形成中医组合拳，以大幅提升临床疗效。</p><p><br></p><p><img src="data:image/png;base64,"></p><p><br></p><p>	<span style="color: rgb(0, 0, 0);">2017年5月，江西省中医院被纳入中医药传承创新工程储备库。为更好地发挥中医药特色优势、进一步提升中医药防治重大疑难疾病能力，江西省中医院借鉴全国中医经典病房建设积累的成功经验，于</span>	<span style="color: rgb(0, 0, 0);">2021年4月开始筹建中医经典科。科室深研中医经典理论和体系，以中医思维解决临床各种疑难问题；科室团队由急诊、呼吸、心血管、消化、风湿免疫、骨科等科室抽调优秀医师组成，具备全科医学服务功能；科室为多科综合诊疗模式，解决患者因病情复杂、一人多病而往返各科诊疗的难题和困境，也为众多疑难杂症、希望接受中医治疗的患者提供了更多选择。</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span></span></p>','/api/upload/1597551792399319041.jpg',null);
